import React from 'react'
import { Menu, Layout } from 'antd';
import styled from 'styled-components'

const { Header } = Layout;

const StyledHeader = styled(Header)`
    display: flex;
    padding: 24px;
    height: 70px;
    width: 100%;
`;

const SeparateLogoMenu = styled.div`
    display: flex;
    justify-content: space-between
`;

const Navbar: React.FC = () => {
    return (
        <StyledHeader>
            <SeparateLogoMenu>
                <img height={100} src={require('../../assets/images/logo.png')} alt={"MasterSeats Logo"}/>
                <Menu>
                    <Menu.Item>
                        Home
                    </Menu.Item>
                    <Menu.Item>
                        Login
                    </Menu.Item>
                    <Menu.Item>
                        Sign Up
                    </Menu.Item>
                </Menu>
            </SeparateLogoMenu>
            <p>hello</p>
        </StyledHeader>
    )
}

export default Navbar
